import './App.css';
import styled from "styled-components"

function App() {


  const alertBtn = () => {
    alert('버튼을 만들어보세요');
  }


  return (
    <div>
      <ButtonDiv>
        <h1>Button</h1>
        <div>
          <Primary onClick={alertBtn}>Large Primary Button</Primary>
          <button>Medium</button>
          <button>Small</button>
        </div>
        <div>
          <button>Large Negative Button</button>
          <button>Medium</button>
          <button>Small</button>
        </div>
      </ButtonDiv>
      <br/>

      <h1>Input</h1>
      <div>
        <label>이름</label>
        <input/>
        <label>가격</label>
        <input/>
        <button>저장</button>
      </div>
      <br/>

      <h1>Modal</h1>
      <div>
        <button>open modal</button>
        <button>open modal</button>
      </div>
      <br/>

      <div>
      <h1>Select</h1>
      <button></button>
      <button></button>
      </div>
    </div>
  );
}

export default App;

const ButtonDiv = styled.div`
    display: flex;
    flex-direction: column;
    gap: 10px;
`

const PrimaryDiv = styled.div`
    display: flex;
    flex-direction: row;
    gap: 10px;
`

const Primary = styled.button`
    cursor: pointer;
    border-radius: 8px;
    color: rgb(0, 0, 0);
    height: 50px;
    width: 200px;
    border: 3px solid #e0e094;
    background-color: #f5f5dc;
    font-weight: 600;
`
